(1, 2, 2, 1, 'Most active courses (Thursday, 23 March 2017, 4:02 PM)', '<pre class="sql"></pre>', 'sql', 0, 'a:3:{s:9:"customsql";a:1:{s:6:"config";O:8:"stdClass":6:{s:8:"querysql";s:191:"SELECT+COUNT%28l.id%29+hits%2C+l.course+courseId%2C+c.fullname+coursename%0D%0AFROM+prefix_log+l+INNER+JOIN+prefix_course+c+ON+l.course+%3D+c.id%0D%0AGROUP+BY+courseId%0D%0AORDER+BY+hits+DESC";s:8:"courseid";i:1;s:12:"submitbutton";s:12:"Save+changes";s:16:"reportcategories";s:1:"0";s:17:"reportsincategory";s:1:"0";s:14:"remotequerysql";s:0:"";}}s:4:"plot";a:1:{s:8:"elements";a:1:{i:0;a:5:{s:2:"id";s:15:"BbUzkSwsMr4G0E1";s:8:"formdata";O:8:"stdClass":3:{s:5:"width";i:900;s:6:"height";i:500;s:12:"submitbutton";s:3:"Add";}s:10:"pluginname";s:3:"bar";s:14:"pluginfullname";s:9:"Bar+chart";s:7:"summary";s:17:"Bar+chart+summary";}}}s:7:"filters";a:1:{s:8:"elements";a:0:{}}}', 'ods,xls,', 1, 0, 2, 0, 0),
(2, 2, 2, 1, 'Courses that are defined as using GROUPs (Thursday, 23 March 2017, 4:04 PM)', '<pre class="sql"></pre>', 'sql', 0, 'a:2:{s:9:"customsql";a:1:{s:6:"config";O:8:"stdClass":6:{s:8:"querysql";s:423:"SELECT+concat%28%27%3Ca+target%3D%22_new%22+href%3D%22%25%25WWWROOT%25%25%2Fgroup%2Findex.php%3Fid%3D%27%2Cc.id%2C%27%22%3E%27%2Cc.fullname%2C%27%3C%2Fa%3E%27%29+AS+Course%0D%0A%2C%28SELECT+COUNT%28%2A%29+FROM+prefix_course_modules+cm+WHERE+cm.course+%3D+c.id%29+Modules%0D%0A%2C%28SELECT+COUNT%28%2A%29+FROM+prefix_groups+g+WHERE+g.courseid+%3D+c.id%29+Groups%0D%0A+FROM+%60prefix_course%60+AS+c%0D%0AWHERE+groupmode+%3E+0";s:8:"courseid";i:1;s:12:"submitbutton";s:12:"Save+changes";s:16:"reportcategories";s:1:"0";s:17:"reportsincategory";s:1:"0";s:14:"remotequerysql";s:0:"";}}s:4:"plot";a:1:{s:8:"elements";a:1:{i:0;a:5:{s:2:"id";s:15:"o98AsjWZBKAd9Yb";s:8:"formdata";O:8:"stdClass":3:{s:8:"areaname";s:1:"1";s:9:"areavalue";s:1:"2";s:12:"submitbutton";s:3:"Add";}s:10:"pluginname";s:3:"pie";s:14:"pluginfullname";s:3:"Pie";s:7:"summary";s:11:"A+pie+graph";}}}}', 'ods,xls,', 1, 0, 1, 0, 0);
