(4, 2, 1, 'deferredfeedback', 1, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these operators can be used to concatenate two or more String objects?\n\n: +\n\n; +=\n\n; &\n\n; ||\n\n', '+\n\n', '+\n\n', 1489813346),
(5, 2, 2, 'deferredfeedback', 2, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these method of class String is used to obtain length of String object?\n\n: get()\n\n; length()\n\n; lengthof()\n\n; sizeOf()\n\n', 'length()\n\n', 'length()\n\n', 1489813346),
(6, 2, 3, 'deferredfeedback', 3, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these constructors is used to create an empty String object?\n\n: String()\n\n; String(void)\n\n; String(0)\n\n; none\n\n', 'String()\n\n', 'String()\n\n', 1489813346),
(7, 3, 1, 'deferredfeedback', 4, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these functions is called to display the output of an applet?\n\n: printApplet()\n\n; displayApplet()\n\n; print()\n\n; display()\n\n', 'print()\n\n', 'display()\n\n', 1489815018),
(8, 3, 2, 'deferredfeedback', 5, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these modifiers can be used for a variable so that it can be accessed from any thread or parts of a program?\n\n: Global\n\n; Volatile\n\n; Transient\n\n; No modifier is needed\n\n', 'Volatile\n\n', 'Transient\n\n', 1489815018),
(9, 3, 3, 'deferredfeedback', 7, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these operators can be used to get run time information about an object?\n\n: getinfoof\n\n; info\n\n; getInfo\n\n; instanceof\n\n', 'instanceof\n\n', 'getinfoof\n\n', 1489815018),
(10, 4, 1, 'deferredfeedback', 4, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these functions is called to display the output of an applet?\n\n: printApplet()\n\n; print()\n\n; displayApplet()\n\n; display()\n\n', 'print()\n\n', 'print()\n\n', 1490630174),
(11, 4, 2, 'deferredfeedback', 5, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these modifiers can be used for a variable so that it can be accessed from any thread or parts of a program?\n\n: Global\n\n; No modifier is needed\n\n; Transient\n\n; Volatile\n\n', 'Volatile\n\n', 'Transient\n\n', 1490630174),
(12, 4, 3, 'deferredfeedback', 7, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these operators can be used to get run time information about an object?\n\n: info\n\n; getinfoof\n\n; getInfo\n\n; instanceof\n\n', 'instanceof\n\n', 'getinfoof\n\n', 1490630174),
(13, 5, 1, 'deferredfeedback', 11, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these packages contain all the Javas built in exceptions?\n\n: java.lang\n\n; java.net\n\n; java.io\n\n; java.util\n\n', 'java.lang\n\n', 'java.net\n\n', 1490630242),
(14, 5, 2, 'deferredfeedback', 12, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Thread priority in Java is?\n\n: double\n\n; long\n\n; Integer\n\n; Float\n\n', 'Integer\n\n', 'double\n\n', 1490630242),
(15, 5, 3, 'deferredfeedback', 13, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these statements is incorrect?\n\n: Two thread in Java can have same priority\n\n; A thread can exist only in two states, running and blocked\n\n; By multithreading CPUs idle time is minimized, and we can take maximum use of it.\n\n; By multitasking CPUs idle time is minimized, and we can take maximum use of it\n\n', 'A thread can exist only in two states, running and blocked\n\n', 'A thread can exist only in two states, running and blocked\n\n', 1490630242),
(16, 6, 1, 'deferredfeedback', 4, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these functions is called to display the output of an applet?\n\n: displayApplet()\n\n; printApplet()\n\n; display()\n\n; print()\n\n', 'print()\n\n', 'display()\n\n', 1491194946),
(17, 6, 2, 'deferredfeedback', 5, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these modifiers can be used for a variable so that it can be accessed from any thread or parts of a program?\n\n: Transient\n\n; Global\n\n; No modifier is needed\n\n; Volatile\n\n', 'Volatile\n\n', 'Global\n\n', 1491194946),
(18, 6, 3, 'deferredfeedback', 7, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these operators can be used to get run time information about an object?\n\n: getinfoof\n\n; getInfo\n\n; info\n\n; instanceof\n\n', 'instanceof\n\n', 'getInfo\n\n', 1491194947),
(19, 7, 1, 'deferredfeedback', 8, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these methods are used to register a keyboard event listener?\n\n: eventKeyboardListener()\n\n; addKistener()\n\n; KeyListener()\n\n; addKeyListener()\n\n', 'addKeyListener()\n\n', 'KeyListener()\n\n', 1491198109),
(20, 7, 2, 'deferredfeedback', 9, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Which of these packages contains all the classes and methods required for even handling in Java?\n\n: java.awt\n\n; java.event\n\n; java.awt.event\n\n; java.applet\n\n', 'java.awt.event\n\n', 'java.event\n\n', 1491198109),
(21, 7, 3, 'deferredfeedback', 10, 1, '1.0000000', '0.0000000', '1.0000000', 0, 'Event class is defined in which of these libraries?\n\n: java.lang\n\n; java.net\n\n; java.util\n\n; java.io\n\n', 'java.util\n\n', 'java.net\n\n', 1491198109);
